import React from 'react';
  
const Home = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Center',
        alignItems: 'Right',
        height: '100vh',
        FontSize: '100px'
      }}
    >
      <h1 className="is-size-2">Welcome to "Name Of the Company"</h1>
      <video src="/videos/video-2.mp4" autoPlay loop muted />
    </div>
  );
};
  
export default Home;
